// src/layouts/MainLayout.jsx
import React, { useState } from 'react';
import Sidebar from '../components/Sidebar';
import DashboardTable from '../components/DashboardTable';
import { Button, Modal, Form } from 'react-bootstrap';

const MainLayout = () => {
  const [sidebarVisible, setSidebarVisible] = useState(true);
  const [students, setStudents] = useState([
    { name: 'John Doe', role: 'Admin', email: 'john@example.com' },
    { name: 'Jane Smith', role: 'Editor', email: 'jane@example.com' },
    { name: 'Bob Brown', role: 'Viewer', email: 'bob@example.com' },
    { name: 'Alice Johnson', role: 'Admin', email: 'alice@example.com' },
    { name: 'Tom Clark', role: 'Editor', email: 'tom@example.com' },
    { name: 'Sara Davis', role: 'Viewer', email: 'sara@example.com' },
    { name: 'Mike Wilson', role: 'Admin', email: 'mike@example.com' },
    { name: 'Laura Lee', role: 'Editor', email: 'laura@example.com' },
    { name: 'Steve Rogers', role: 'Viewer', email: 'steve@example.com' },
    { name: 'Emily White', role: 'Admin', email: 'emily@example.com' },
  ]);

  // Modal State
  const [showModal, setShowModal] = useState(false);
  const [formData, setFormData] = useState({ name: '', role: '', email: '' });

  const handleAddStudent = () => setShowModal(true);
  const handleRemoveStudent = () => setStudents(prev => prev.slice(0, -1));

  const handleCloseModal = () => {
    setShowModal(false);
    setFormData({ name: '', role: '', email: '' });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setStudents(prev => [...prev, formData]);
    handleCloseModal();
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  return (
    <div className="d-flex" style={{ height: '100vh' }}>
      {sidebarVisible && (
        <Sidebar
          onAddStudent={handleAddStudent}
          onRemoveStudent={handleRemoveStudent}
        />
      )}

      <div className="flex-grow-1">
        {/* Header */}
        <div className="p-2 border-bottom d-flex justify-content-between align-items-center">
          <Button
            variant="outline-primary"
            size="sm"
            onClick={() => setSidebarVisible(!sidebarVisible)}
          >
            {sidebarVisible ? '&#x276F' : '/276E'}
          </Button>
        </div>

        {/* Table */}
        <DashboardTable data={students} />
      </div>

      {/* Add Student Modal */}
      <Modal show={showModal} onHide={handleCloseModal}>
        <Modal.Header closeButton>
          <Modal.Title>Add New Student</Modal.Title>
        </Modal.Header>
        <Form onSubmit={handleSubmit}>
          <Modal.Body>
            <Form.Group className="mb-3">
              <Form.Label>Name</Form.Label>
              <Form.Control
                required
                name="name"
                value={formData.name}
                onChange={handleChange}
                placeholder="Enter name"
              />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label>Role</Form.Label>
              <Form.Control
                required
                name="role"
                value={formData.role}
                onChange={handleChange}
                placeholder="Enter role (e.g. Student)"
              />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label>Email</Form.Label>
              <Form.Control
                required
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                placeholder="Enter email"
              />
            </Form.Group>
          </Modal.Body>
          <Modal.Footer>
            <Button variant="secondary" onClick={handleCloseModal}>
              Cancel
            </Button>
            <Button type="submit" variant="primary">
              Add Student
            </Button>
          </Modal.Footer>
        </Form>
      </Modal>
    </div>
  );
};

export default MainLayout;
